import {BrowserRouter as Router,Route,Switch} from "react-router-dom";
import Home from './pages/Home.js';
import About from "./pages/About.js";
const App= () =>{
    return (
        <>
            <Router>
                <Switch>
                    <Route path="/" component={Home} exact/> 
                    <Route path="/about" component={About} exact/>
                </Switch>
            </Router>
        </>
    )
}
export default App;
